import React, { Component } from 'react';

class SidePage extends Component {
    render() {
        return (
            <div className='side-bar'>
                <ul>
                    <li>المادة ١</li>
                    <li>المادة ٢</li>
                    <li>المادة ٣</li>
                    <li>المادة ٤</li>
                    <li>المادة ٥</li>
                    <li>المادة ٦</li>
                </ul>
            </div>
        );
    }
}

export default SidePage;
